#Objective Function for Minimization
def obj_fcn(x0,distance_traveled,dt,vel_acc,vel_dec,travel_time,np):
    
    return abs(distance_traveled - (dt * np.sum(x0*vel_acc)) - 
    (dt * np.sum(x0*vel_dec)) - (x0 * (0.50 * travel_time)))

######################################################################################################

#Finite Difference (Derivative)
def finite_difference_derivative(t,x,np):
    
    """
    Compute the first derivative using finite differences.
    
    Parameters:
    - t: array of t values
    - x: array of x values
    
    Returns:
    - dx_dt: array of computed derivative values
    """
    
    # Calculate the step size
    dt = t[1] - t[0]
    
    # Compute the derivative using central differences (excluding edges)
    dx_dt = (x[2:] - x[:-2]) / (2 * dt)
    
    # Handle the edges using forward/backward differences
    dx_dt = np.concatenate(([0], dx_dt, [0]))
    
    return dx_dt

