#Drive Cycle Generation
def drive_cycle(params,fcns):
    
    #Extract Function Parameters
    distance_traveled, travel_time, nsample = params
    
    #Extract Included Functions
    np, minimize, interp1d = fcns
    
    #Velocity Acceleration Coefficients
    vel_acc_coeff = [-2,+3,+0,+0]
        
    #VelocityAcceleration Coefficients
    vel_dec_coeff = [+2,-3,+0,+1]
    
    #Normalized Time Vector (s)
    vel_norm_time = np.linspace(0.0, 1.0, num=nsample)
    
    #Initialize Variable
    vel_acc = np.zeros((len(vel_norm_time),))
    vel_dec = np.zeros((len(vel_norm_time),))
    
    #Normalized Acceleration Trajectory (m/s)
    for ii in range(len(vel_norm_time)):
        vel_acc[ii] = ((vel_acc_coeff[0] * (vel_norm_time[ii] ** 3)) + 
        (vel_acc_coeff[1] * (vel_norm_time[ii] ** 2)) + 
        (vel_acc_coeff[2] * (vel_norm_time[ii] ** 1)) + 
        (vel_acc_coeff[3] * (vel_norm_time[ii] ** 0)))
    
    #Normalized Deceleration Trajectory (m/s)
    for ii in range(len(vel_norm_time)):
        vel_dec[ii] = ((vel_dec_coeff[0] * (vel_norm_time[ii] ** 3)) + 
        (vel_dec_coeff[1] * (vel_norm_time[ii] ** 2)) + 
        (vel_dec_coeff[2] * (vel_norm_time[ii] ** 1)) + 
        (vel_dec_coeff[3] * (vel_norm_time[ii] ** 0)))
  
    #Fixed Step (s)
    dt = 0.25 * travel_time * (vel_norm_time[1] - vel_norm_time[0])

    #Optimize to Find Velocity
    result = minimize(obj_fcn,0,args=(distance_traveled,dt,vel_acc,vel_dec,travel_time,np))
    
    #Fixed Step 0.0001
    FixedStep = vel_norm_time[1] - vel_norm_time[0]
    
    #Acceleration/Deceleration Time
    acc_time = 0.00*travel_time+np.arange(0, 0.25*travel_time+FixedStep, FixedStep)
    dec_time = 0.75*travel_time+np.arange(0, 0.25*travel_time+FixedStep, FixedStep)
    
    #Acceleration/Deceleration Velocity Profile Interpolation
    vel_acc_fcn = interp1d(vel_norm_time, result.x[0]*vel_acc, kind='linear')
    vel_dec_fcn = interp1d(vel_norm_time, result.x[0]*vel_dec, kind='linear')
    
    # Velocity Profile Interpolation
    vel_fcn = interp1d(np.concatenate((acc_time,dec_time),axis=0), 
    np.concatenate((vel_acc_fcn(np.linspace(0, 1, len(acc_time))),
    vel_dec_fcn(np.linspace(0, 1, len(dec_time)))),axis=0), kind='linear')

    #Time Vector
    time = np.linspace(0.0*travel_time, 1.0*travel_time, num=int(travel_time/FixedStep)+1)

    #Velocity (m/s)
    vel = vel_fcn(time)
    
    #Position (m)
    pos = (time[1] - time[0]) * np.cumsum(vel)
    
    #Acceleration Profile (m/s^2)
    acc = finite_difference_derivative(time, vel,np)

    return time, pos, vel, acc

