#Wind Velocity Vector Decomposition
def wind_velocity_vector_decomposition(params,fcns):
    # print(params)

    #Extract Parameters
    [p1, p2, Vxw, 𝜑, 𝜃] = params
    
    #Extract Functions
    [np, math] = fcns
    
    #Convert from Originating Wind Direction to Acting Wind Direction
    if 𝜑 >= 180:
        𝛽 = 𝜑 - 180;
    else:
        𝛽 = 𝜑 + 180;
        
    #Rotational Matrix
    Rm = [[+1.0*math.cos(-1.0*𝜃*(math.pi/180)), -1.0*math.sin(-1.0*𝜃*(math.pi/180))],\
                  [+1.0*math.sin(-1.0*𝜃*(math.pi/180)), +1.0*math.cos(-1.0*𝜃*(math.pi/180))]]

    #Wind Acting in Direction
    Vxy = np.matmul(Rm,[[Vxw*math.cos(𝛽*(math.pi/180))],[Vxw*math.sin(𝛽*(math.pi/180))]])

    #Wind Acting in Longitudinal
    Vw = Vxy[0][0]

    return Vw
           
