#Exergy/Energy Cost
def exenf_cost(params,fcns):         

    #Extract Parameters
    [p1, p2, dT, platform_name, Ma, Vxw, 𝜑, 𝜃, debug] = params
    
    #Extract Functions
    [np, minimize, interp1d, math, os] = fcns
    
    ###########################################################################
    
    #Define Module Functions
    fcns = [math, np, interp1d] 
    
    #Instantiate Universal Constants Object
    conts = contsObj()
    
    #Instantiate Parameters Object
    param = paramObj(platform_name,Ma,fcns)
    
    ###########################################################################
    
    #Define Module Parameters
    params = [p1, p2]
    
    #Define Module Functions
    fcns = math 
    
    #Vector Decomposition (m, rad)
    L, 𝛽 = vector_decomposition(params,fcns)
    
    ###########################################################################
    
    #Define Module Parameters
    params = [p1, p2, Vxw, 𝜑, 𝜃]
    
    #Define Module Functions
    fcns = [np, math] 

    #Wind Velocity (m/s) (Need to Know x1,y1,z1 and x2,y2,z2 location relative to lat/long or magnetic north)
    Vw = wind_velocity_vector_decomposition(params,fcns)
    
    ###########################################################################
    
    #Define Module Parameters
    params = [L, dT, 1001]
    
    #Define Module Functions
    fcns = [np, minimize, interp1d] 
    
    #Drive Cycle (s,m,m/s,m/s^2)
    t, Px, Vx, Ax = drive_cycle(params,fcns)
    
    ###########################################################################

    #Define Module Parameters
    params = [conts, param, 𝛽, Vw, t, Vx, Ax]
    
    #Define Module Functions
    fcns = [math, np]

    #Tractive Force Requirements
    Fx = tractive_force_requirements(params, fcns)

    ###########################################################################
    
    #Define Module Parameters
    params = [t, Vx, Fx]
    
    #Define Module Functions
    fcns = np
    
    #Tractive Power Requirements
    Pw, Pb = tractive_power_requirements(params,fcns)
    
    ###########################################################################
    
    #Define Module Parameters
    params = [param, t, Pw, Pb]
    
    fcns = [math, np]
    
    #Aggregate Power and Energy Requirements
    Preq, Ereq, Preg, Ereg = aggregate_power_energy_requirement(params,fcns)
    
    ###########################################################################
    
    if debug == True:
        
        #Define Module Parameters
        params = [t, Px, Vx, Ax, Fx, Pw, Pb, Preq, Ereq, Preg, Ereg, 𝛽, Vw, param, conts]
        
        #Define Module Functions
        fcns = [math, np, os]
        
        #Export Files
        export_files(params,fcns)
        
    ###########################################################################
    
    #Energy Consumed (kJ)
    Jcon = Ereq[len(t)-1]
    
    #Energy Generated (kJ)
    Jgen = Ereg[len(t)-1]
    
    #Maximum Permissible Grade/Payload
    𝛽max = param.maximum_permissible_grade
    Mmax = param.maximum_payload
    

    #Assess Grade
    if (𝛽 * (180 / math.pi)) > 𝛽max:
        msgA = 'Excceded Maximum Permissible Grade' 
    else:
        msgA = 'Acceptable Grade'

    #Assess Payload
    if Ma > Mmax:
        msgB = 'Excceded Maximum Payload' 
    else:
        msgB = 'Acceptable Payload'

    #Concatenate Message
    msg = msgA + ' , ' + msgB  
        
    return Jcon, Jgen, msg

