#Vector Decomposition
def vector_decomposition(params,fcns):   

    #Extract Parameters
    [initial_point, final_point] = params
    
    #Extract Functions
    math = fcns

    #Extract X/Y/Z Locations
    x1 = initial_point[0]
    y1 = initial_point[1]
    z1 = initial_point[2]

    #Extract X/Y/Z Locations
    x2 = final_point[0]
    y2 = final_point[1]
    z2 = final_point[2]
    
    #Distance Between 3D Points (Hypotenuse)
    L = math.sqrt(((x2 - x1) * (x2 - x1)) + ((y2 - y1) * (y2 - y1)) + ((z2 - z1) * (z2 - z1)))

    #Adjacent Length
    La = math.sqrt(((x2 - x1) * (x2 - x1)) + ((y2 - y1) * (y2 - y1)))

    #Angle from (x1,y1,z1) ---> (x2,y2,z2)
    if (z2 - z1) < 0:
        𝜃 = -1.0 * math.acos(La / L)
    else:
        𝜃 = +1.0 * math.acos(La / L)
    
    return L, 𝜃
    
