#Tractive Force Requirements
def tractive_force_requirements(params,fcns):
    
    #Extract Parameters
    [conts, param, 𝛽, Vw, t, Vx, Ax] = params

    #Extract Universal Constants Parameters
    g = conts.acceleration_due_to_gravity
    𝜌 = conts.density_of_air
    
    #Extract Asset Parameters
    Cd  = param.drag_coefficient
    H   = param.height
    W   = param.width
    Mc  = param.curb_mass
    Ma  = param.added_mass
    𝜇   = param.rolling_friction_coefficient
    Vth = param.velocity_threshold
    
    #Extract Functions
    math, np = fcns
    
    #Initialize Variable
    Fx  = np.zeros((len(t),))
    
    #Compute Tractive Force and Break Force
    for ii in range(len(t)):
    
        #Normal Force
        Fn = normal_force(g, Mc, Ma, 𝛽, math)
    
        #Aerodynamic Drag Force (N)
        Fd = aerodynamic_drag_force(𝜌, Cd, H, W, Vx[ii], Vw, np)
        
        #Grade Force (N)
        Fg = grade_force(g, Mc, Ma, 𝛽, math)

        #Rolling Resistance Force (N)
        Fr = rolling_resistance_force(Vth, 𝜇, Fn, Vx[ii], math)
        
        #Inertial Force
        Fa = inertial_force(g, Mc, Ma, Ax[ii])

        #Tractive Force
        Fx[ii] = Fa + Fd + Fg + Fr

        #Axel Normal Force Decomposition
        #Fzf, Fzr = axel_normal_force_decomposition(g, Mc, Ma, Nw, Lf, Lr, Lh, Fd, Fg, Fa, Fr, 𝛽, math)

    return Fx
     
