#Tractive Power Requirement
def tractive_power_requirements(params,fcns):

    #Extract Module Parameters
    [t, Vx, Fx] = params
    
    #Extract Module Functions
    np = fcns
    
    #Initialize Variable
    Pw  = np.zeros((len(t),))
    Pb  = np.zeros((len(t),))
    
    #Compute Tractive Power Requirement
    for ii in range(len(t)):
        
        #Power Requirement
        Pwr = Vx[ii] * Fx[ii]
        
        #Tractive Power Requirements
        if Pwr >= 0.0:
            Pw[ii] = Pwr
            Pb[ii] = 0.0
        else:
            Pw[ii] = 0.0
            Pb[ii] = np.abs(Pwr)
        
    return Pw, Pb

######################################################################################################       

#Aerodynamic Drag Force
def aerodynamic_drag_force(𝜌, Cd, H, W, Vx, Vw, np):
    
    #Aerodynamic Drag Force (N)
    Fd = 0.5 * 𝜌 * Cd * (H * W) * ((Vx + Vw) * (Vx + Vw)) * sgn(Vx,Vw)

    return Fd

######################################################################################################       

#Grade Force
def grade_force(g, Mc, Ma, 𝛽, math):
    
    #Grade Force (N)
    Fg = g * (Mc + Ma) * math.sin(𝛽)
    
    return Fg

######################################################################################################       

#Rolling Resistance Force
def rolling_resistance_force(Vth, 𝜇, Fn, Vx, math):
    
    #Rolling Resistance Force (N)
    Fr = Fn * 𝜇 * math.tanh((4 * Vx) / Vth)
    
    return Fr

######################################################################################################  

#Inertial Force
def inertial_force(g, Mc, Ma, Ax):
    
    #Rolling Resistance Force (N)
    Fa = (Mc + Ma) * Ax
    
    return Fa 
    
######################################################################################################  

#Normal Force
def normal_force(g, Mc, Ma, 𝛽, math):
    
    #Rolling Resistance Force (N)
    Fn = g * (Mc + Ma) * math.cos(𝛽)
    
    return Fn 
     
######################################################################################################  

#Axel Normal Force Decomposition
def axel_normal_force_decomposition(g, Mc, Ma, Nw, Lf, Lr, Lh, Fd, Fg, Fa, Fr, 𝛽, math):
    
    #Front Axel Force (N)
    Fzf = (-Lh * (Fd + Fg + Fa + Fr) + (Lr * g * (Mc + Ma) * math.cos(𝛽))) / (Nw * (Lf + Lr))

    #Rear Axel Force (N)
    Fzr = (+Lh * (Fd + Fg + Fa + Fr) + (Lf * g * (Mc + Ma) * math.cos(𝛽))) / (Nw * (Lf + Lr))
    
    return Fzf, Fzr

######################################################################################################  

#Greater Than or Equal
def sgn(Vx,Vw): 

    #Condition
    if (Vx + Vw) >= 0:
        Condition = True
    else:
        Condition = False
        
    return +1 * (2*Condition - 1)

