#Aggregate Power and Energy Requirement
def aggregate_power_energy_requirement(params,fcns):

    #Extract Module Parameters
    [param, t, Pw, Pb] = params
    
    #Extract Asset Parameters
    ac_motor_generator_mech_to_elec_fcn = param.ac_motor_generator_mech_to_elec_fcn
    ac_motor_generator_elec_to_mech_fcn = param.ac_motor_generator_elec_to_mech_fcn
    ac_dc_conv_ac_to_dc_fcn             = param.ac_dc_conv_ac_to_dc_fcn
    ac_dc_conv_dc_to_ac_fcn             = param.ac_dc_conv_dc_to_ac_fcn
    rated_ac_mot_gen_pwr                = param.rated_ac_mot_gen_pwr
    rated_ac_dc_conv_pwr                = param.rated_ac_dc_conv_pwr
    
    #Extract Module Functions
    [math, np] = fcns
    
    #Right Motor Power Requirements (W)
    Prm_req = 1000 * rated_ac_mot_gen_pwr * ac_motor_generator_mech_to_elec_fcn(((1/1000) * (1/rated_ac_mot_gen_pwr) * (Pw/2)))

    #Left Motor Power Requirements (W)
    Plm_req = 1000 * rated_ac_mot_gen_pwr * ac_motor_generator_mech_to_elec_fcn(((1/1000) * (1/rated_ac_mot_gen_pwr) * (Pw/2)))
    
    #Right Motor Converter Power Requirements (W)
    Prc_req = 1000 * rated_ac_dc_conv_pwr * ac_dc_conv_ac_to_dc_fcn(((1/1000) * (1/rated_ac_dc_conv_pwr) * (Prm_req)))
    
    #Left Motor Converter Power Requirements (W)
    Plc_req = 1000 * rated_ac_dc_conv_pwr * ac_dc_conv_ac_to_dc_fcn(((1/1000) * (1/rated_ac_dc_conv_pwr) * (Plm_req)))
    
    #Power Requirements
    Preq = Prc_req + Plc_req
    
    #Right Motor Power Generation (W)
    Prm_reg = 1000 * rated_ac_mot_gen_pwr * ac_motor_generator_elec_to_mech_fcn(((1/1000) * (1/rated_ac_mot_gen_pwr) * (Pb/2)))
    
    #Left Motor Power Generation (W)
    Plm_reg = 1000 * rated_ac_mot_gen_pwr * ac_motor_generator_elec_to_mech_fcn(((1/1000) * (1/rated_ac_mot_gen_pwr) * (Pb/2)))
    
    #Right Motor Converter Power Generation (W)
    Prc_reg = 1000 * rated_ac_dc_conv_pwr * ac_dc_conv_dc_to_ac_fcn(((1/1000) * (1/rated_ac_dc_conv_pwr) * (Prm_reg)))
    
    #Left Motor Converter Power Generation (W)
    Plc_reg = 1000 * rated_ac_dc_conv_pwr * ac_dc_conv_dc_to_ac_fcn(((1/1000) * (1/rated_ac_dc_conv_pwr) * (Plm_reg)))
    
    #Generation Requirements
    Preg = Prc_reg + Plc_reg
    
    #Energy Requirements (kJ)
    Ereq = ((t[1]-t[0]) * np.cumsum(Preq)) / 1000
    
    #Energy Generation (kJ)
    Ereg = ((t[1]-t[0]) * np.cumsum(Preg)) / 1000
    
    return Preq, Ereq, Preg, Ereg

