#Direction of Travel
def direction_of_travel(initial_point,final_point,math):

    #Initial X/Y/Z Points
    x1 = initial_point[0]
    y1 = initial_point[1]
    z1 = initial_point[2]    

    #Final X/Y/Z Points
    x2 = final_point[0]
    y2 = final_point[1]
    z2 = final_point[2]  
    
    #X/Y Lengths (m)
    x = x2 - x1
    y = y2 - y1
    
    #Hypotenuse
    h = math.sqrt((x * x) + (y * y))
    
    if x >= 0 and y >= 0:
        heading = 90 - (math.asin((y / h)) * 180/(math.pi))
    elif x >= 0 and y < 0:
        heading = 90 - (math.asin((y / h)) * 180/(math.pi))
    elif x < 0 and y < 0:
        heading = 270 + (math.asin((y / h)) * 180/(math.pi))
    else:
        heading = 270 + (math.asin((y / h)) * 180/(math.pi))

    #Wrap Heading 0 Degrees to 359.999 Degrees
    if heading >= 360:
        heading = 360 - heading
    
    return heading

