#Export Files
def export_files(params,fcns):

    #Extract Module Parameters
    [t, Px, Vx, Ax, Fx, Pw, Pb, Preq, Ereq, Preg, Ereg, 𝛽, Vw, param, conts] = params
    
    #Extract Constants
    𝜌 = conts.density_of_air
    g = conts.acceleration_due_to_gravity
    
    #Extract Parameters
    Vmax = param.maximum_longitudinal_velocity
    𝛽max = param.maximum_permissible_grade
    Rw   = param.wheel_radius
    Mc   = param.curb_mass
    Ma   = param.added_mass
    Mmax = param.maximum_payload
    Nw   = param.number_of_wheels_per_axel
    Na   = param.number_of_axels
    L    = param.length
    W    = param.width
    H    = param.height
    Lf   = param.horizontal_distance_from_cg_to_front_axel
    Lr   = param.horizontal_distance_from_cg_to_rear_axel
    Lh   = param.cg_height_above_ground
    Cd   = param.drag_coefficient
    𝜇    = param.rolling_friction_coefficient
    Vth  = param.velocity_threshold
    Prmg = param.rated_ac_mot_gen_pwr
    Prad = param.rated_ac_dc_conv_pwr
    
    #Extract Module Functions
    [math, np, os] = fcns

    #File Directory
    if os.path.isdir(os.getcwd() + "\\Data"):
        RootDir = os.getcwd() + "\\Data\\"
    else:
        RootDir = os.getcwd() + "\\"

    #Create Array
    array = np.concatenate((np.reshape(t,(len(t),1)),np.reshape(Px,(len(t),1)),\
                            np.reshape(Vx,(len(t),1)),np.reshape(Ax,(len(t),1)),\
                            np.reshape(Fx,(len(t),1)),np.reshape(Pw,(len(t),1)),\
                            np.reshape(Pb,(len(t),1)),np.reshape(Preq,(len(t),1)),\
                            np.reshape(Ereq,(len(t),1)),np.reshape(Preg,(len(t),1)),\
                            np.reshape(Ereg,(len(t),1))), axis = 1)

    #Export Drive Cycle
    np.savetxt(RootDir + 'drive_cycle.txt', array, fmt='%8.8f', delimiter=',',
                comments='',header = "Time,Position,Velocity,Acceleration," +\
                    "TractiveForce,WheelPower,BrakePower,"+\
                    "AggregatePowerRequirement,AggregateEnergyRequirement,"+\
                    "AggregatePowerGeneration,AggregateEnergyGeneration")
    
    #Create Array
    array = np.array([𝜌, g, Vmax, 𝛽max, Rw, Mc, Ma, Mmax, Nw, Na, L, W, H, Lf, Lr, Lh, Cd, 𝜇, Prmg, Prad, Vth, 𝛽, Vw])
    array = np.reshape(array, (1,len(array)))
    
    #Export Drive Cycle
    np.savetxt(RootDir + 'asset_parameters.txt', array, fmt='%8.8f', delimiter=',',
                comments='',header="AirDensity,GravitationalAcceleration,"+\
                    "MaximumLongitudinalVelocity,MaximumPermissibleAngle,"+\
                    "WheelRadius,CurbMass,AddedMass,MaximumPayload,"+\
                    "NumberOfWheels,NumberOfAxels,Lenght,Width,Height,"+\
                    "HorizontalDistanceFromCGToFrontAxel,"+\
                    "HorizontalDistanceFromCGToRearAxel,"+\
                    "CGHeightAboveGround,DragCoefficient,"+\
                    "RollingFrictionCoefficient,RatedMotorGeneratorPower,"+\
                    "RatedAcDcConverterPower,ThresholdVelocity,InclineAngle,WindVelocity")

